    slt $t7, $t6, $t2                 
    beq $t7, $zero, sea_full_done      # Exit if y >= height
    
    li $t7, 0                          

sea_full_col_loop:
    # Check if reached display width
    slt $t8, $t7, $t1                  
    beq $t8, $zero, sea_full_next_row  

    # Default to sea_light color
    add $t8, $s0, $zero                

    # Simplified wave pattern calculation
    add $a0, $t7, $t6                  
    srl $a0, $a0, 3                    
    add $a0, $a0, $t9                  
    andi $a0, $a0, 0x3F                

    # Simple horizontal pattern
    srl $a1, $t7, 2                 
    add $a1, $a1, $t9                 
    andi $a1, $a1, 0x3F               

    # Simple binary decision for most pixels
    add $a3, $a0, $a1                  
    andi $a3, $a3, 0x3F               
    slti $k0, $a3, 32                  
    
    # Choose color based on pattern
    beq $k0, $zero, use_light_full     # If k0=0 (value >= 32), use light color
    add $t8, $zero, $t3                # Use highlight color

use_light_full:
    # Calculate pixel address
    mul $a0, $t6, $t1                  
    add $a0, $a0, $t7                  
    sll $a0, $a0, 2                   
    add $a0, $a0, $t0                  
    sw $t8, 0($a0)                     

    addi $t7, $t7, 1                   # Increment x-counter
    j sea_full_col_loop

sea_full_next_row:
    addi $t6, $t6, 1                   # Increment y-counter
    j sea_full_row_loop

sea_full_done:
    # Reset section to 0 to start partial updates again
    li $t0, 0
    sw $t0, update_section
    jal play_fanfare
    # Show popup to press space
    li $v0, 55
    la $a0, space_to_start_msg
    syscall

wait_for_space:

    # Get keyboard ready bit address
    lw $t0, KEYBOARD_ADDR
    addi $t0, $t0, -4                 

    # Check if a key is ready
    lw $t1, 0($t0)                    
    andi $t1, $t1, 1                  
    
    beqz $t1, wait_for_space           # If no key ready, keep waiting

    lw $t0, KEYBOARD_ADDR

    # Read character from keyboard
    lw $t1, 0($t0)                    
    andi $t1, $t1, 0xFF               

    # Check for spacebar
    li $t9, ' '                       
    bne $t1, $t9, wait_for_space      # If not space, wait again
    
    # Space pressed, jump back to main loop
    j main
check_space_key:

    lw $t0, KEYBOARD_ADDR

    # Read character from keyboard
    lw $t1, 0($t0)                    
    andi $t1, $t1, 0xFF               

    # Check for spacebar
    li $t9, ' '                       
    sub $t0, $t1, $t9
    bne $t0, $zero, wait_for_space    # If not space, wait again
    
    # Space pressed, return to main game loop
    lw $ra, 0($sp)
    addi $sp, $sp, 4
    jr $ra
# Main animation loop
main:
    # Draw the sea and submarine
    jal draw_sea_partial               
    jal draw_sea_at_submarine         
    jal move_shark                     
    jal draw_shark                     
    jal draw_image_submarine           

    # Update animation state
    lw $t0, animation_offset           
    addi $t0, $t0, 1                   
    andi $t0, $t0, 0xFF              
    sw $t0, animation_offset          

    # Update the section of sea to redraw next frame
    lw $t0, update_section             
    addi $t0, $t0, 1                   
    andi $t0, $t0, 0x3                 
    sw $t0, update_section           

    # Check for input and collisions
    jal check_keyboard                 
    jal check_collision              

    # Frame rate control
    lw $t1, frame_counter           
    addi $t1, $t1, 1                 
    sw $t1, frame_counter            

    lw $t2, frame_rate           
    slt $t3, $t1, $t2                  
    beq $t3, $zero, reset_counter      
    j skip_delay                      

reset_counter:
    # Reset frame counter when we reach target rate
    li $t1, 0                         
    sw $t1, frame_counter              

skip_delay:
    j main                        # Loop back to start of main loop
    

# ---- Function: Draw sea at submarine position (to clear old position) ----
draw_sea_at_submarine:

    addi $sp, $sp, -4
    sw $ra, 0($sp)

    # Load submarine's previous position
    lw $t0, sub_x                    
    lw $t1, prev_sub_y              
    lw $t2, sub_length                
    lw $t3, sub_width               

    # Calculate rectangle to clear (centered on submarine's old position)
    srl $t4, $t2, 1                 
    srl $t5, $t3, 1                 
    sub $t0, $t0, $t4             
    sub $t1, $t1, $t5            

    # Add margin to the rectangle (make it slightly larger than the submarine)
    addi $t0, $t0, -2                 
    addi $t1, $t1, -2               
    addi $t2, $t2, 4                 
    addi $t3, $t3, 4                  

    # Draw one pixel at a time with bounds checking
    li $t6, 0                          # Initialize y-counter

sea_clear_y_loop:
    slt $t9, $t6, $t3                 
    beq $t9, $zero, sea_clear_done     
    li $t7, 0                         

sea_clear_x_loop:
    slt $t9, $t7, $t2                  
    beq $t9, $zero, sea_clear_next_y  

    # Calculate actual x, y coordinates
    add $a0, $t0, $t7                  
    add $a1, $t1, $t6                  

    # Check if x, y is within screen bounds
    slti $t9, $a0, 0                 
    bne $t9, $zero, sea_skip_pixel     
    slti $t9, $a1, 0                   
    bne $t9, $zero, sea_skip_pixel    
    
    lw $t8, DISPLAY_WIDTH
    slt $t9, $a0, $t8                 
    beq $t9, $zero, sea_skip_pixel   
    
    lw $t8, DISPLAY_HEIGHT
    slt $t9, $a1, $t8                  
    beq $t9, $zero, sea_skip_pixel     

    # Get animation state for wave pattern
    lw $t9, animation_offset         

    # Calculate pixel position in memory
    jal calc_position                 

    # Calculate wave pattern (same as in draw_sea_partial)
    add $a2, $a0, $a1                  
    srl $a2, $a2, 3                   
    add $a2, $a2, $t9                 
    andi $a2, $a2, 0x3F                

    # Simple horizontal pattern
    srl $a3, $a0, 2                    
    add $a3, $a3, $t9                  
    andi $a3, $a3, 0x3F                

    # Simple binary decision for most pixels
    add $k0, $a2, $a3                
    andi $k0, $k0, 0x3F            
    slti $k1, $k0, 32                 

    # Load sea colors
    lw $t8, sea_light                
    lw $k0, sea_highlight             

    # Choose color based on pattern
    beq $k1, $zero, use_light_sea    
    add $t8,$zero , $k0                      

use_light_sea:
    sw $t8, 0($v0)                    

sea_skip_pixel:
    addi $t7, $t7, 1                   # Increment x-counter
    j sea_clear_x_loop                

sea_clear_next_y:
    addi $t6, $t6, 1                   # Increment y-counter
    j sea_clear_y_loop                 

sea_clear_done:
    lw $ra, 0($sp)
    addi $sp, $sp, 4
    jr $ra                             

# ---- Function: Draw only 1/4 of the sea each frame for faster animation ----
draw_sea_partial:
    addi $sp, $sp, -8
    sw $ra, 0($sp)
    sw $s0, 4($sp)

    # Load bitmap base and dimensions
    lw $t0, BITMAP_BASE               
    lw $t1, DISPLAY_WIDTH              
    lw $t2, DISPLAY_HEIGHT          

    # Load sea colors
    lw $s0, sea_light                 
    lw $t3, sea_highlight              

    # Get animation state
    lw $t9, animation_offset          

    # Get section to update (0-3)
    lw $t4, update_section           

    # Calculate row range for this section
    li $t5, 64                         
    mul $t6, $t4, $t5                 
    add $t5, $t6, $t5                  

    # Only process rows for current section
sea_row_loop:
    li $t7, 0                         

sea_col_loop:
    # Default to sea_light color
    add $t8, $s0, $zero               

    # Simplified wave pattern calculation
    add $a0, $t7, $t6                  
    srl $a0, $a0, 3                    
    add $a0, $a0, $t9                  
    andi $a0, $a0, 0x3F               

    # Simple horizontal pattern
    srl $a1, $t7, 2                   
    add $a1, $a1, $t9             
    andi $a1, $a1, 0x3F              

    # Simple binary decision for most pixels
    add $a3, $a0, $a1                  
    andi $a3, $a3, 0x3F               
    slti $k0, $a3, 32                  
    
    # Replace beqz with explicit compare
    beq $k0, $zero, use_light          

    # Check if gradient is needed
    slti $k0, $a3, 4                  
    
    # Replace bnez with explicit compare
    bne $k0, $zero, light_to_highlight_gradient
    
    slti $k0, $a3, 28                  
    
    # Replace beqz with explicit compare
    beq $k0, $zero, highlight_to_light_gradient 

    # Core highlight region
    add $t8, $t3, $zero               
    j store_pixel                    

use_light:
    # Use light color directly
    add $t8, $s0, $zero                
    j store_pixel                 

light_to_highlight_gradient:
    # Simple 50/50 blend of light and highlight colors
    # Extract R components
    srl $a0, $s0, 16                   
    andi $a0, $a0, 0xFF
    srl $k1, $t3, 16                   
    andi $k1, $k1, 0xFF
    add $a0, $a0, $k1                 
    srl $a0, $a0, 1                    
    sll $a0, $a0, 16      
                 
    # Extract G components
    srl $v0, $s0, 8                    
    andi $v0, $v0, 0xFF
    srl $k1, $t3, 8                    
    andi $k1, $k1, 0xFF
    add $v0, $v0, $k1                  
    srl $v0, $v0, 1                    
    sll $v0, $v0, 8                    

    # Extract B components
    add $v1, $s0, $zero                
    andi $v1, $v1, 0xFF
    add $k1, $t3, $zero                
    andi $k1, $k1, 0xFF
    add $v1, $v1, $k1                  
    srl $v1, $v1, 1                   

    # Combine RGB components
    or $t8, $a0, $v0                   # Combine R and G
    or $t8, $t8, $v1                   # Combine with B
    j store_pixel                      

highlight_to_light_gradient:
    # Same as light_to_highlight_gradient
    j light_to_highlight_gradient    

store_pixel:
    # Calculate pixel address
    mul $a0, $t6, $t1                  
    add $a0, $a0, $t7               
    sll $a0, $a0, 2                    
    add $a0, $a0, $t0                  
    sw $t8, 0($a0)                     

    # Optimization: Draw 2x2 pixel blocks
    add $a0, $a0, 4                    
    sw $t8, 0($a0)                    

    # Next column (skip one for 2x2 blocks)
    addi $t7, $t7, 2               
    
    # Replace blt with slt + beq
    slt $k0, $t7, $t1                
    bne $k0, $zero, sea_col_loop      

    # Next row (skip one for 2x2 blocks)
    addi $t6, $t6, 1                   
    
    # Replace blt with slt + beq
    slt $k0, $t6, $t5                  
    bne $k0, $zero, sea_row_loop       

    lw $s0, 4($sp)
    lw $ra, 0($sp)
    addi $sp, $sp, 8
    jr $ra                            

# ---- Function: Calculate display position ----
calc_position:
    # Get display base address
    lw $v0, BITMAP_BASE                
    lw $t0, DISPLAY_WIDTH             

    # Calculate position = base + 4 * (y * width + x)
    mul $t1, $a1, $t0                 
    add $t1, $t1, $a0                
    sll $t1, $t1, 2                    
    add $v0, $v0, $t1                 

    jr $ra                             

# ---- Function: Draw submarine image at current position ----
draw_image_submarine:
    addi $sp, $sp, -16
    sw $ra, 0($sp)
    sw $s0, 4($sp)
    sw $s1, 8($sp)
    sw $s2, 12($sp)

    # Load submarine position and image dimensions
    lw $s0, sub_x                     
    lw $s1, sub_y                     
    lw $s2, sub_img_width          
    lw $s3, sub_img_height          
    lw $t2, sub_direction         

    # Calculate top-left corner of image
    li $t0, 2                          
    div $s2, $t0                       
    mflo $t0                           
    div $s3, $t0                      
    mflo $t1                         
    sub $s0, $s0, $t0                 
    sub $s1, $s1, $t1                 

    # Draw the image
    li $t3, 0                         

image_row_loop:
    # Check if all rows are drawn
    beq $t3, $s3, image_done           

    # Handle row index based on direction
    add $t9, $zero, $t3        
    
    # If direction is down (2), invert the row index
    li $t5, 2                          
    bne $t2, $t5, normal_direction    
    
    # Invert row for downward direction
    sub $t9, $s3, $t3                
    addi $t9, $t9, -1                
    
normal_direction:
    # Calculate base address for this row in color array
    mul $t5, $t9, $s2                  
    sll $t5, $t5, 2                   
    la $t6, color_array                
    add $t6, $t6, $t5                 
    
    # Reset column counter
    li $t4, 0                         

image_col_loop:
    # Check if we've drawn all columns
    beq $t4, $s2, next_image_row       

    # Load color from array
    sll $t5, $t4, 2                    
    add $t7, $t6, $t5               
    lw $t8, 0($t7)                    

    # Skip transparent pixels (color = 0)
    li $t5, 0                      
    beq $t8, $t5, skip_pixel          

    # Calculate screen position
    add $a0, $s0, $t4             
    add $a1, $s1, $t3                

    # Check if pixel is within screen bounds (x >= 0)
    li $t5, 0                         
    slt $t7, $a0, $t5                  
    bne $t7, $zero, skip_pixel         
    
    # Check if y >= 0
    slt $t7, $a1, $t5                 
    bne $t7, $zero, skip_pixel         
    
    # Check if x < display width
    lw $t5, DISPLAY_WIDTH             
    slt $t7, $a0, $t5              
    beq $t7, $zero, skip_pixel         
    
    # Check if y < display height
    lw $t5, DISPLAY_HEIGHT             
    slt $t7, $a1, $t5                
    beq $t7, $zero, skip_pixel        

    # Draw pixel
    jal calc_position
    sw $t8, 0($v0)                     

skip_pixel:
    addi $t4, $t4, 1                   # Move to next column
    j image_col_loop

next_image_row:
    addi $t3, $t3, 1                   # Move to next row
    j image_row_loop

image_done:
    lw $s2, 12($sp)
    lw $s1, 8($sp)
    lw $s0, 4($sp)
    lw $ra, 0($sp)
    addi $sp, $sp, 16
    jr $ra
# ---- Function: Draw shark ----
draw_shark:
    addi $sp, $sp, -16
    sw $ra, 0($sp)
    sw $s0, 4($sp)
    sw $s1, 8($sp)
    sw $s2, 12($sp)

    lw $s0, shark_x        
    lw $s1, shark_y          
    lw $s2, shark_width      

    li $t3, 0              
    lw $t4, shark_height     

shark_row_loop:
    # Check if row counter == height
    sub $t7, $t3, $t4
    beq $t7, $zero, shark_done

    li $t5, 0               

    la $t6, shark_color_array
    mul $t7, $t3, $s2       
    sll $t7, $t7, 2         
    add $t6, $t6, $t7      

shark_col_loop:
    # Check if column counter == width
    sub $t7, $t5, $s2
    beq $t7, $zero, next_shark_row

    sll $t7, $t5, 2
    add $t8, $t6, $t7
    lw $t9, 0($t8)         
    
    # Skip if color is 0 (transparent)
    li $t7, 0
    beq $t9, $t7, skip_shark_pixel
    
    add $a0, $s0, $t5      
    add $a1, $s1, $t3      

    # Bounds check (x < 0)
    li $t7, 0
    slt $t8, $a0, $t7     
    bne $t8, $zero, skip_shark_pixel
    
    # Bounds check (x >= DISPLAY_WIDTH)
    lw $t7, DISPLAY_WIDTH
    slt $t8, $a0, $t7       
    beq $t8, $zero, skip_shark_pixel
    
    # Bounds check (y < 0)
    li $t7, 0
    slt $t8, $a1, $t7       
    bne $t8, $zero, skip_shark_pixel
    
    # Bounds check (y >= DISPLAY_HEIGHT)
    lw $t7, DISPLAY_HEIGHT
    slt $t8, $a1, $t7       
    beq $t8, $zero, skip_shark_pixel

    jal calc_position
    sw $t9, 0($v0)

skip_shark_pixel:
    addi $t5, $t5, 1
    j shark_col_loop

next_shark_row:
    addi $t3, $t3, 1
    j shark_row_loop

shark_done:
    lw $ra, 0($sp)
    lw $s0, 4($sp)
    lw $s1, 8($sp)
    lw $s2, 12($sp)
    addi $sp, $sp, 16
    jr $ra

# ---- Function: Move shark left ----
move_shark:
    addi $sp, $sp, -4
    sw $ra, 0($sp)

    # Store previous position for clearing
    lw $t0, shark_x
    sw $t0, shark_prev_x   

    # Move left
    addi $t0, $t0, -20       
    sw $t0, shark_x

    # Clear previous shark position
    jal clear_shark_previous

    # Reset shark position if off-screen (t0 >= 0)
    li $t7, 0
    slt $t8, $t0, $t7       
    beq $t8, $zero, no_reset
    
    # Reset x position
    li $t0, 256
    sw $t0, shark_x
    
    # Generate pseudo-random number
    lw $t1, rand_seed
    lw $t2, rand_mult
    mul $t3, $t1, $t2      
    lw $t4, rand_inc
    add $t3, $t3, $t4       
    lw $t5, rand_mod
    div $t3, $t5           
    mfhi $t3               
    sw $t3, rand_seed      
    
    # Scale to desired range
    lw $t4, shark_y_range
    mul $t3, $t3, $t4       
    div $t3, $t5            
    mflo $t3                
    lw $t4, shark_y_min
    add $t3, $t3, $t4       
    
    # Store new y position
    sw $t3, shark_y
    
no_reset:
    # Restore return address
    lw $ra, 0($sp)
    addi $sp, $sp, 4
    jr $ra

# ---- New Function: Clear shark's previous position ----
clear_shark_previous:
    addi $sp, $sp, -12
    sw $ra, 0($sp)
    sw $s0, 4($sp)
    sw $s1, 8($sp)

    # Load shark's previous position
    lw $s0, shark_prev_x
    lw $s1, shark_y
    
    # Only clear if previous position is valid and different from current
    lw $t0, shark_x
    beq $s0, $t0, skip_clear  # Skip if positions are the same
    
    # Skip if previous position was off-screen (s0 < 0)
    li $t7, 0
    slt $t8, $s0, $t7       
    bne $t8, $zero, skip_clear

    # Get shark dimensions
    lw $t2, shark_width
    lw $t3, shark_height

    # Draw sea pattern at previous shark position
    li $t4, 0         

shark_clear_y_loop:
    # Check if y-counter >= shark_height
    slt $t7, $t4, $t3     
    beq $t7, $zero, shark_clear_done
    
    li $t5, 0            

shark_clear_x_loop:
    # Check if x-counter >= shark_width
    slt $t7, $t5, $t2    
    beq $t7, $zero, shark_clear_next_y

    # Calculate pixel position
    add $a0, $s0, $t5   
    add $a1, $s1, $t4   

    # Check if within screen bounds (x >= 0)
    li $t7, 0
    slt $t8, $a0, $t7     
    bne $t8, $zero, shark_skip_pixel
    
    # Check if y >= 0
    slt $t8, $a1, $t7     
    bne $t8, $zero, shark_skip_pixel
    
    # Check if x < DISPLAY_WIDTH
    lw $t6, DISPLAY_WIDTH
    slt $t8, $a0, $t6     
    beq $t8, $zero, shark_skip_pixel
    
    # Check if y < DISPLAY_HEIGHT
    lw $t6, DISPLAY_HEIGHT
    slt $t8, $a1, $t6     
    beq $t8, $zero, shark_skip_pixel

    # Get animation state for wave pattern
    lw $t9, animation_offset

    # Calculate pixel position in memory
    jal calc_position

    # Calculate wave pattern (same as in draw_sea_partial)
    add $a2, $a0, $a1      
    srl $a2, $a2, 3        
    add $a2, $a2, $t9      
    andi $a2, $a2, 0x3F    

    # Simple horizontal pattern
    srl $a3, $a0, 2        
    add $a3, $a3, $t9     
    andi $a3, $a3, 0x3F    

    # Pattern decision
    add $k0, $a2, $a3      
    andi $k0, $k0, 0x3F    
    li $t7, 32
    slt $k1, $k0, $t7      

    # Load sea colors
    lw $t8, sea_light      
    lw $k0, sea_highlight  

    # Choose color based on pattern
    li $t7, 0
    beq $k1, $t7, use_light_shark  # If k1 == 0, use light color
    add $t8, $zero, $k0    

use_light_shark:
    sw $t8, 0($v0)         #

shark_skip_pixel:
    addi $t5, $t5, 1
    j shark_clear_x_loop

shark_clear_next_y:
    addi $t4, $t4, 1
    j shark_clear_y_loop

shark_clear_done:
skip_clear:
    lw $s1, 8($sp)
    lw $s0, 4($sp)
    lw $ra, 0($sp)
    addi $sp, $sp, 12
    jr $ra
# ---- Function: Check submarine-shark collision ----
check_collision:
    addi $sp, $sp, -4
    sw $ra, 0($sp)

    # Load positions and dimensions
    lw $t0, sub_x           
    lw $t1, sub_y           
    lw $t2, sub_length      
    lw $t3, sub_width      
    lw $t4, shark_x         
    lw $t5, shark_y         
    lw $t6, shark_width      
    lw $t7, shark_height     
    lw $t8, nb_lifes         

    # Calculate submarine boundaries (using div by 2 instead of sra)
    li $s7, 2
    div $t2, $s7             
    mflo $s0
    div $t3, $s7             
    mflo $s1
    
    sub $a0, $t0, $s0        
    add $a1, $t0, $s0       
    sub $a2, $t1, $s1      
    add $a3, $t1, $s1       

    # Calculate shark boundaries 
    add $s0, $t4, $zero     
    add $s1, $t4, $t6      
    add $s2, $t5, $zero      
    add $s3, $t5, $t7        

    # Check for collision 
    slt $t9, $s1, $a0        
    bne $t9, $zero, no_collision
    
    slt $t9, $a1, $s0        
    bne $t9, $zero, no_collision
    
    slt $t9, $s3, $a2        
    bne $t9, $zero, no_collision
    
    slt $t9, $a3, $s2       
    bne $t9, $zero, no_collision

    # Collision occurred, decrement lives

    addi $t8, $t8, -1
    sw $t8, nb_lifes

    # Check if out of lives
    bne $t8, $zero, still_alive
    j game_over
    
still_alive:
    jal Collisionsound
    li $v0, 55               
    la $a0, collision_msg    
    syscall
continue_game:
    # Reset shark position after collision
    li $t0, 256              
    sw $t0, shark_x

no_collision:
    lw $ra, 0($sp)
    addi $sp, $sp, 4
    jr $ra
game_over:
    jal game_over_image

part_2: 
    # Explicitly load game over message
    la $a0, game_over_msg     
    li $v0, 50                
    syscall                  
    
    # Check result
    bltz $a0, Exit            # If canceled, exit
    beqz $a0, restart_game    # If "Yes", restart
    j Exit                    # If "No", exit
# ---- Function: Check keyboard for input ----
check_keyboard:
    lw $t3, sub_y                     
    sw $t3, prev_sub_y                

    addi $sp, $sp, -4
    sw $ra, 0($sp)

    lw $t0, KEYBOARD_ADDR
    addi $t0, $t0, -4                 

    # Check if a key is ready
    lw $t1, 0($t0)                    
    andi $t1, $t1, 1                  
    
    # Compare to zero (using sub and bne instead of beqz)
    sub $t9, $t1, $zero
    bne $t9, $zero, key_ready
    j check_done                      

key_ready:
    lw $t0, KEYBOARD_ADDR

    # Read character from keyboard
    lw $t1, 0($t0)                    
    andi $t1, $t1, 0xFF               

    # Get submarine's current position
    lw $t2, sub_x                     
    lw $t3, sub_y                     
    lw $t5, DISPLAY_HEIGHT            
    lw $t7, sub_length                

    # Check for 'w' - move up
    li $t9, 'w'                       
    sub $t0, $t1, $t9
    bne $t0, $zero, not_up            
    
    li $t4, 0                         
    sw $t4, sub_direction             
    addi $t3, $t3, -10                
    
    slt $t0, $t3, $zero             
    bne $t0, $zero, reset_position
    j update_position                 

not_up:
    # Check for 's' - move down
    li $t9, 's'                       
    sub $t0, $t1, $t9
    bne $t0, $zero, check_done        
    
    li $t4, 2                         
    sw $t4, sub_direction             
    addi $t3, $t3, 10                 
    add $t8, $t3, $t7                 
    
    slt $t0, $t5, $t8        
    bne $t0, $zero, reset_position
    j update_position                 

reset_position:
    # Reset position to previous valid position
    lw $t3, sub_y                     

update_position:
    # Update submarine's y-position
    sw $t3, sub_y                    

check_done:
    lw $ra, 0($sp)
    addi $sp, $sp, 4
    jr $ra                   
Exit: 
    li $v0, 10
    syscall
game_over_image:
    lw $t0, BITMAP_BASE   
    beqz $t0, bitmap_base_error  # Jump to error handler if BITMAP_BASE is zero

    la $t1, game_over_color_array       
    beqz $t1, color_array_error  # Jump to error handler if color array is not loaded

    li $t2, 0                 
    li $t3, 65536            

game_over_display_loop:
    beq $t2, $t3, game_over_display_done       # Exit if all pixels are processed
    
    lw $t4, 0($t1)          
    sw $t4, 0($t0)         
    
    addi $t0, $t0, 4       
    addi $t1, $t1, 4         
    addi $t2, $t2, 1         
    j game_over_display_loop  

game_over_display_done:
    jal PlaySong 
    li $v0, 50
    la $a0, game_over_msg
    syscall
    
    # Check result 
    slt $t9, $a0, $zero     
    bne $t9, $zero, restart_game
    
    sub $t9, $a0, $zero     
    bne $t9, $zero, Exit
    j restart_game

bitmap_base_error:
    li $v0, 55  
    la $a0, bitmap_base_error_msg
    syscall
    j Exit

color_array_error:
    li $v0, 55 
    la $a0, color_array_error_msg
    syscall
    j Exit
    
